<!--(1PSRU)kats.lk009.info--><li><a href="http://www.lk009.info/">Неадекватность человеческой реакции на тот или иной раздражитель называется уже какой-то фобией. Именно этой темой увлекся английский писатель Джеймс Баллард. Одержимость человека какой-то идеей делает его непредсказуемым - таковы герои его произведений.</a><!--/kats.lk009.info(1PSRU)-->
<!--(1PSRU)kats.lk006.info--><li><a href="http://www.lk006.info/">Писатель, который закончил свою жизни в безумии, и в которого в голове происходили и всплывали события его жизни. Вернувшись во Францию, после многих лет скитаний, и набравшись жизненного опыта, он стал писать приключенческие романы, которым не было равных. </a><!--/kats.lk006.info(1PSRU)-->
<!--(1PSRU)kats.lk007.info--><li><a href="http://www.lk007.info/">Три закона роботехники были сформированы Айзеком Азимовым, уже делают его уникальным и оригинальным писателем 20 века. Английский писатель, который родился территории бывшего Советского Союза, но вовремя судьбой был перемещен на территорию США.</a><!--/kats.lk007.info(1PSRU)-->
