<!--(1PSRU)kats.lk005.info--><li><a href="http://www.lk005.info/">Генри Райдер Хаггард - уникальный человек, который смог любить раз и на всю жизнь. Нереализованная любовь которого определила его судьбу и он стал писателем. Английский джентльмен, который интересовался культурой и историей африканских народов.</a><!--/kats.lk005.info(1PSRU)-->
