<!--(1PSRU)kats.lk003.info--><li><a href="http://www.lk003.info/">Вальтер Скотт - писатель, который удивляет своей феноменальной памятью, впитывающей, как губка, все происходящее вокруг него. Писатель, который смог самообразованием достичь успехов. </a><!--/kats.lk003.info(1PSRU)-->
<!--(1PSRU)hit.lk018.info--><li><a href="http://www.lk018.info/">Роджер Желязны - писатель, который увлекался психологией, мистикой. дзюдо и медитацией,что и сделало его произведения интересными и разноплановыми для чтения и восприятия.</a><!--/hit.lk018.info(1PSRU)-->
