<!--(1PSRU)hit.lk017.info--><li><a href="http://www.lk017.info/">Эксперемент по тому сможет ли писатель заработать больше писательской деятельностью, нежели научной, завершился успешно. За год писатель смог заработать больше, чем он поставил себе целью в начале года.</a><!--/hit.lk017.info(1PSRU)-->
